module.exports = {
  root: true,
  extends: ['@theguild'],
  ignorePatterns: ['packages/render-graphiql/src/graphiql.ts'],
  overrides: [
    {
      files: ['packages/graphql-yoga/src/plugins/**/*.ts'],
      rules: {
        'unicorn/filename-case': 'off',
      },
    },
    {
      files: ['**/_meta.{ts,js,tsx}'],
      rules: {
        'import/no-default-export': 'off',
      },
    },
    {
      files: ['examples/**/*'],
      rules: {
        'import/extensions': 'off',
        'unicorn/filename-case': 'off',
        'no-console': 'off',
        'import/no-default-export': 'off',
      },
    },
    {
      files: [
        '**/__tests__/**',
        '**/*.spec.ts',
        '**/*.test.ts',
        'e2e/**',
        '**/__integration-tests__/**',
      ],
      rules: {
        '@typescript-eslint/no-non-null-assertion': 'off',
        'import/extensions': 'off',
        'unicorn/filename-case': 'off',
      },
    },
    {
      files: ['e2e/**'],
      rules: {
        'no-console': 'off',
      },
    },
    {
      files: ['packages/graphiql/**', 'packages/render-graphiql/**'],
      rules: {
        'unicorn/filename-case': 'off',
        'import/extensions': 'off',
        'import/no-default-export': 'off',
      },
    },
    {
      files: ['packages/**/*'],
      rules: {
        'import/no-extraneous-dependencies': [
          'error',
          {
            devDependencies: [
              '**/*.test.ts',
              '**/*.spec.ts',
              '**/scripts/*.js',
              '**/vite.config.ts',
            ],
          },
        ],
        'no-restricted-imports': [
          'error',
          {
            paths: [
              {
                name: 'graphql',
                importNames: ['execute', 'subscribe', 'graphql', 'executeSync', 'graphqlSync'],
                message: 'Please use `normalizedExecutor` from `@graphql-tools/executor` instead.',
              },
            ],
          },
        ],
      },
    },
  ],
};

module.exports = {
  presets: [
    ['@babel/preset-env', { targets: { node: process.versions.node.split('.')[0] } }],
    '@babel/preset-typescript',
  ],
  plugins: [
    'babel-plugin-transform-typescript-metadata',
    ['@babel/plugin-proposal-decorators', { legacy: true }],
    'babel-plugin-parameter-decorator',
    '@babel/plugin-transform-class-properties',
  ],
};

/* eslint-disable @typescript-eslint/no-var-requires */
const { resolve } = require('node:path');
const { pathsToModuleNameMapper } = require('ts-jest');
const CI = !!process.env.CI;

const ROOT_DIR = __dirname;
const TSCONFIG = resolve(ROOT_DIR, 'tsconfig.json');
const tsconfig = require(TSCONFIG);

process.env.LC_ALL = 'en_US';

const testMatch = [];

let testTimeout = undefined;

if (process.env.INTEGRATION_TEST === 'true') {
  testTimeout = 10_000;
  testMatch.push('<rootDir>/**/__integration-tests__/**/?(*.)+(spec|test).[jt]s?(x)');
  if (parseInt(process.versions.node.split('.')[0]) <= 14) {
    testMatch.push('!**/examples/sveltekit/**', '!**/examples/fastify*/**');
  }
  testMatch.push('!**/examples/bun*/**');
} else {
  testMatch.push(
    '<rootDir>/packages/**/?(*.)+(spec|test).[jt]s?(x)',
    '!**/__integration-tests__/**',
  );
}

// tests that leak due to external dependencies
if (process.env.LEAKS_TEST === 'true') {
  testMatch.push(
    '!**/hackernews.spec.ts',
    '!**/apollo-link.spec.ts',
    '!**/urql-exchange.spec.ts',
    '!**/apollo-link.spec.ts',
    '!**/uwebsockets.test.ts',
    '!**/apollo-client.test.ts',
    '!**/browser.spec.ts',
    '!**/egg.spec.ts',
    '!**/sveltekit.spec.ts',
  );
}

testMatch.push('!**/dist/**', '!**/.bob/**');

module.exports = {
  testEnvironment: 'node',
  rootDir: ROOT_DIR,
  restoreMocks: true,
  reporters: ['default'],
  modulePathIgnorePatterns: ['dist'],
  moduleNameMapper: pathsToModuleNameMapper(tsconfig.compilerOptions.paths, {
    prefix: `${ROOT_DIR}/`,
  }),
  collectCoverage: false,
  cacheDirectory: resolve(ROOT_DIR, `${CI ? '' : 'node_modules/'}.cache/jest`),
  testMatch,
  testTimeout,
  resolver: 'bob-the-bundler/jest-resolver',
  // jest-snapshots don't support prettier v3 (https://github.com/jestjs/jest/issues/14305)
  prettierPath: null,
};

import prettierConfig from '@theguild/prettier-config';

// eslint-disable-next-line unicorn/prefer-export-from, import/no-default-export
export default prettierConfig;

{
  "$schema": "https://docs.renovatebot.com/renovate-schema.json",
  "extends": ["github>the-guild-org/shared-config:renovate", ":preserveSemverRanges"],
  "automerge": true,
  "major": {
    "automerge": false
  },
  "lockFileMaintenance": {
    "enabled": true,
    "automerge": true
  },
  "packageRules": [
    {
      "groupName": "envelop",
      "matchPackageNames": ["/@envelop/*/"]
    },
    {
      "groupName": "whatwg-node",
      "matchPackageNames": ["/@whatwg-node/*/"]
    },
    {
      "matchUpdateTypes": ["minor", "patch"],
      "groupName": "all non-major dependencies",
      "groupSlug": "all-minor-patch",
      "matchPackageNames": [
        "!/@changesets/*/",
        "!/typescript/",
        "!/typedoc*/",
        "!/^@theguild//",
        "!/@graphql-inspector/core/",
        "!/next/",
        "!/@envelop/*/",
        "!/@whatwg-node/*/",
        "!/@graphql-yoga/*/",
        "!/graphql-yoga/",
        "!/lru-cache/",
        "!/sofa-api/",
        "!/husky/",
        "*"
      ]
    }
  ],
  "ignoreDeps": ["@sveltejs/kit", "graphiql", "graphql-yoga"],
  "ignorePaths": ["**/__tests__/**", "**/test/**", "**/tests/**", "**/__fixtures__/**"],
  "baseBranches": ["main"]
}

{
  "github": {
    "silent": true
  }
}
